(21, '정현우', '1.13<br/>주일에 조카가 와서 놀아주느라 주일이 바빴다고 함.<br/>순장(최건희)의 연락에 답은 없고 다른 지체들과는 연락이 됨.<br/>1.12<br/>주말에 순장과 연락이 안되었음. 예배는 드렸고 순모임은 참여하지 않음.<br/>같이 만나서 이야기를 나눴는데 권징기간을 본인식으로 보내고 있는 것 같았음.<br/>아무것도 하지 않고 멍 때리는 시간,  자신에게 집중한다,  공동체로 왜 같이 해야하는지 모르겠다, 의미없다 , 정감 형제들을 부정적으로 대하는 태도 등<br/>공동체로, 헬퍼리더로 권면하기가 쉽지 않았다.<br/>그래도 이야기 할 것들을 이야기 했고 힘이 나지 않는다고 해서 기도회부터 같이 해보자고 했으나 들어오지는 않았다. ', NULL, 2, 5, '', '01092866593', '남', NULL, NULL, 14, NULL, 11, '2019-09-30 17:11:03', NULL, '1', 'N'),
(22, '백계진', '4월11<br/>병원에 취업함. 인턴정도는 아니고 간단업무나, 환자들 돌보기 일을 하고 있어서 당분간 온라인 예배 드릴 예정.<br/><br/>02.24<br/>주일 저녁시간을 활용해서 형제들을 만나고 챙기려 애쓰고 있음.<br/>평일에는 가게 일이 늦게 마무리 되서 경건생활이나 일대일에 마음을 잘 못둠.', NULL, 2, 5, '', '01090255241', '남', NULL, NULL, 22, NULL, 11, '2019-09-30 17:11:13', NULL, '1', 'N'),
(23, '김해냄', '3.16<br/>목사님 .. 요즘 정감 팀모임 상황이 여러 어려움들이 있습니다ㅠㅠ<br/>최근에 해냄이랑 민호,건희오빠 사이에서 잦은 갈등들이 많은데..<br/>일단 민호오빠를 해냄이가 그냥 답답해 해요 그래서 별다른 갈등이 일어나진 않지만 일단 민호오빠가 본인이 말 잘못해서<br/>해냄이가 뭐라고 할까봐 되게 눈치보는데 정도가 거의 눌려있는 정도로 차라리 말을 안해야겠다고 마이크를 끄거나 그렇고..<br/>해냄이가 건희오빠를 요즘 많이 어려워하는데.. 약간 저런데도 엘더라고? 라는 시선으로 계속 대하니까 대화가 거의 잘 안되고<br/>전에 오빠를 사랑하기로 결단했다 했는데 그 뒤로 더 어렵다고 해요..ㅎㅎ 마음이 어떤지는 금요일에 만나기로 해서 같이<br/>나눠보려고 하구요~ 요즘 정감팀 리더모임 상황이나,리더들 관계가 참 쉽지가 않은데<br/>이걸 엘더모임에서 나누기가 어려워요.. 저번에 현준이 일도 그렇고 엘더모임에서 나누는 것들을 주옥이가 해냄이랑 나누는 것 같은데  지난주에 건희오빠가 정감리더들 안에 어려움들이 좀 있다는 식으로 나눴는데 그 후에 해냄이가 더 싸늘해진 것을 볼때 어느정도 해냄이한테 얘기가 들어가는것이 아닌가 싶고.. 이게 직접 얘기가 나눠지지 않고 전해 들으면 더 어려움이 되니까 나누기가 쉽지가 않아요ㅠㅠ 지난주에는 민호오빠가 해냄이한테 마음이 상해서 한번만 더 그러면 만나서 얘기하겠다 하고.. 민호오빠도 건희오빠도 해냄이도 팀모임때 마음들이 너무 어렵네요...ㅠㅠ<br/><br/>1.12<br/>팀에 마음을 많이 쓰려고 애쓰는 부분들이 감사하다.<br/>그러나 팀모임때 형제오빠들을 대하는 태도들이 아슬아슬하다.<br/>#002오빠가 사람을 잘 본다고 생각하지 않아#002 #002알겠냐구 이 형제들아#002<br/>등 형제들이 불편한 상황들이 몇번 있었는데<br/>형제들보다는 자매가 권면하는게 좋은데 어떻게 권면할 수 있을 지 지혜를 구해요', NULL, 2, 5, '910520', '01090295598', '여', NULL, NULL, 11, NULL, 11, '2019-09-30 17:11:24', NULL, '1', 'N'),
(24, '손경준', '2.13<br/>경건생활이 많이 무너져있고, 현재의 상황이 경건생활에 영향을 많이 주는 것 같음. (쉬고 있는상황)<br/>현재의 마음이 흔들리다보니 이전에 경험했던 하나님의 은혜도 가짜였나 싶은 생각도 함.<br/>코로나 후유증으로 미각상실이 있다는 뉴스를 접하면서 ', NULL, 2, 5, '', '01025532642', '남', NULL, NULL, 11, NULL, 11, '2019-09-30 17:11:35', NULL, '1', 'N'),
(25, '강석미', '3.13<br/>코로나로 사람들을 거의 안만났는데 요즘에는 만나려고 함. 팀장이랑도 오늘 올해 처음으로 만남.<br/>혼자 시간을 보내는것을 많이 좋아해서 집에서 개인시간을 많이 보내고 , 평일에 근처에 사는 친언니 집에 가서 조카들 봐주고 지냄.<br/>작년 재작년부터 하나님에 대한 마음이 많이 사라진거 같고 최근에는 많이 굳어진거 같이 느낌.<br/>말씀을 왜 읽어야 하는지 모르겠고 <br/>정독 시작할때 권면했을때 시편을 읽고 있다고 했는데 지금은 아예 안되고 있는 상황.<br/>조카들을 자주 보게 되서 현장예배는 나오기가 더 어려움 ㅠㅠ', '', 2, 5, '', '01029776214', '여', NULL, NULL, 11, NULL, 11, '2019-09-30 17:11:41', NULL, '1', 'N'),
(26, '성찬희', '1.14<br/>매주 예배는 드리고 있고,  매주는 아니더라도 순모임에 참여해볼 것을 순장(엄정훈)이 권면하려고 함.', '', 2, 5, '', '01087765579', '남', NULL, NULL, 15, NULL, 11, '2019-09-30 17:11:55', NULL, '1', 'N'),
(27, '이가희', '02.24<br/>한동안 #001왜 저렇게 말하고 행동할까?#001 하며 미워하는 지체가 있었는데 자신의 마음을 비춰보게 되는 말씀의 은혜가 있었음. 영혼의 티보다 정작 본인의 들보를 보지 못하고  정직하지 않은 마음들을 돌아보며 정말 봐야할 본질들을<br/>구하게 됨.', '', 2, 5, '', '01020603281', '여', NULL, NULL, 10, NULL, 11, '2019-09-30 17:12:10', NULL, '1', 'N'),
