(36, '최민호', '3.16<br/>지난주 팀모임때 뭔가 다운되어 보였는데 어머님이 자가격리 하셔서 가정에서 눌리는 것도 있었고<br/>팀모임때 말을 하기가 좀 어렵다고 하는데.. 해냄이랑 관계가 어렵기도 한데, 최근에 가희랑 말로 좀 어려움이 있으면서<br/>해냄이-가희가 서로 주고 받는 영향이 본인한테 크게 오는거 같다고 말해요.<br/>평일에 가희랑 민호오빠랑 뭔가 좀 일이 있으면 그 후에 팀모임때나 만났을때 해냄이가 오빠한테 더 뭐라고 하는 것 같이..<br/>그래서 팀모임때 그냥 말을 안해야겠다고 화가 날 것 같다며 마이크를 끄고 있기도 하고, 주눅이..들어있기도 하고..<br/>02.24<br/>자매순원들을 챙기는 것에 대해 부담이 있어서 자매리더들에게 도움을 요청함.<br/>1.30<br/>최근에 지체들에게 #001네 식대로 듣고 해석한다#001 라는 말들을 듣고 멘탈이 흔들렸다고 함.<br/>건강도 좀 안좋아지면서 힘든 시간을 보냄<br/>1.12<br/>국장으로,  팀리더로, 마음을 쓰려고 노력한다.<br/>마음이 앞서는걸 경계한다고 했는데 다시 마음이 많이 앞서는 것 같다.<br/>마음이 먼저 앞서서 한 행동에 대해 뭔가 말을 들으면 많이 주춤한다ㅠㅠ', NULL, 2, 5, '', '01027560178', '남', NULL, NULL, 14, NULL, 11, '2019-09-30 17:14:09', NULL, '1', 'N'),
(37, '최은수', '5.8<br/>잠을 잘 못자기도 하고, 해가 짧아져서 새벽예배 오는 길이 무섭지 않아 새벽예배를 작정함.<br/>4.20<br/>다니던 직장은 3월 말로 끝남.<br/>쉬면서 다른 직장 알아보는 중.<br/>순모임 하면서 순장(최민호)과 순원들 사이에 중간역할을<br/>잘 해주고 싶은데 잘 안될때가 많음.<br/>그래도 순원들, 순장들 각자 애쓰는 부분들이 있어서 감사함.<br/>1.14<br/>하던 일이 12월까지 단기계약이였는데 무기계약으로 변경?되면서 업무가 더 많아져서 체력적으로 힘들어함 ', NULL, 2, 5, '', '01071255091', '여', NULL, NULL, 18, NULL, 11, '2019-09-30 17:14:14', NULL, '1', 'N'),
(38, '정충만', '1.30<br/>순모임을 잘 참여하고 , 당분간은 온라인 예배 드린다고 함.<br/>설 지나고 만나볼 예정!', '', 2, 5, '', '01024503275', '남', NULL, NULL, 10, NULL, 11, '2019-09-30 17:14:23', NULL, '1', 'N'),
