(40, '엄정훈', '03.13<br/>일주일에 2~3번 정도 경건생활 하는중. <br/>최근에 연기를 이제 정말 놓고, 다른 일을 해야하는지에 대해 생각하게됨.<br/>팀모임할때 순원들을 만나보거나 그런 노력은 안한다.. 라고 해서 3월이 지나기 전에 순원1명 만나볼 것을 미션으로 드렸는데<br/>잘 받아주셔서 해보기로 함.<br/><br/>02.24<br/>기도생활이 잘 되지 않음.<br/>영혼들을 사랑하지 않는것은 아닌 것 같은데 주기적으로 연락해서 안부를 묻거나, 기도하지 않음.<br/>하나님 앞에 본인이 잘 세워지지 않아서 그런것 같다고  말하며 경건생활에 힘쓸것을 다짐함.<br/>02.06<br/>경건생활에 좀 어려움이 있음. 그러다보니 순원들에게 좀 더 소홀히 했던 것 같음.', NULL, 2, 5, '', '01091167845', '남', NULL, NULL, 15, NULL, 11, '2019-09-30 17:14:37', NULL, '1', 'N'),
