(45, '김선영', '1.14<br/>순장(최민호)과 동기여서 연락이 잘 되고 지난주일에 최민호,남윤성,김선영,이은혜 이렇게 만나서 교제했다고 함.<br/>순장이 예배나 순공부를 권면했는데 부담스럽다고 했고 일상 얘기 나눔 정도로 교제하려고 함.', NULL, 2, 5, '', '', '여', NULL, NULL, 14, NULL, 11, '2019-09-30 17:15:17', NULL, '2', 'N'),
