(56, '박수빈', '4월<br/>-병원 근무가 계속 되어서 청년부 예배를 드리고 여러운 상황<br/> 3시쯤 일이 끝나서 퇴근하고 출근 시간이 계속 애매해짐../ 다른 주중 예배 권면중 <br/>', '', 2, 6, '921203', '01065523212', '여', NULL, NULL, 10, NULL, 2, '2019-10-02 10:26:37', NULL, '1', 'N'),
(57, '최동규', '2021년 1월<br/><br/>-현재 광진경찰서 강력계에 근무<br/>-아직은 회사의 눈치를 많이 보는 중<br/>-QT는 꾸준히 하려고 하고 있음<br/>-최근에는 구원의 근심에 대해 나눔을 했음<br/>-9/4일 11시 건대 스타시티 웨딩홀 결혼<br/><br/>2월<br/>-근무지(광진경찰서) 확진자로 인해 2/13일까지 자가격리<br/><br/>4월<br/>-집은 가든파이브근처로 구함 5월에 입주, 혼인신고예정, 5월부터 여자친구도 같이 청년부 나올 예정', '', 2, 6, '891012', '01095600129', '남', NULL, NULL, 13, NULL, 2, '2019-10-02 10:27:01', NULL, '1', 'N'),
(58, '이신애', NULL, '', 1, 3, '930903', '01066323996', '여', NULL, NULL, 9, NULL, 17, '2019-10-02 17:15:25', NULL, '6', 'N'),
(59, '유호연', '중독 <br/>게임 / 성(포르노) / 소설(판타지) / 애니메이션 / 유튜브, 페이스북, 인스타 - 파도타기 (영상을 타고 타고 들어가서 보는 것.)<br/><br/>요즘은 시간이 아깝다는 생각이 많이 들어요..<br/>시간이 없다 없다 하지만, 그것은 없는게 아니라 내지 않을 때가 많은것이며, <br/>무 절제한 쉼 이 제일 우선이였기에.. <br/><br/>책 을 읽으며, 영혼 돌보며,,, 말씀과 기도의 중요성... 사랑합니다 목사님 ♡<br/><br/>3.25 / 이번주 잘 버티고 살아나가다, 수요일에 완전 넉다운.. 운동의 필요성.<br/>5.10/ 어제 보그너에서 미경이랑 저의 무기력함. 목적이 없음을 두고 이야기 한 후에. 집에 돌아감.', NULL, 1, 3, '941227', '01032451779', '남', NULL, NULL, 8, NULL, 17, '2019-10-02 17:15:44', NULL, '1', 'N'),
(60, '이온유', '1/11 최근에 잘 모르겠습니다. 많이 힘들어 하는 느낌..<br/>공부를 해야하지만 열심히 놀았다고 하며, 노량진에서 중고책 구입해옴.<br/><br/>계속해서 종훈, 황요, 규린 과 잘 놀러다님 - 그리고 한 지체가 그 무리에 대해서 계속해서 이야기 함으로 충격을 받았다고 이야기 하지만, 그대로.<br/><br/>#002오전, 오후에는 뭐하는지 모르겠고 저녁에는 스터디공부를 9시부터 1시까지 하고 정리하고 2~3시 쯤 자요#002 생활중<br/><br/>3.25 / 너무나 학업에 치이고 있으며, 조동현과 다툼이후 감정적으로 대처하는 중<br/>5.10 / 이종훈과 관계..  3년전과 같은 전개, 같은 분노.. ', NULL, 1, 3, '970219', '01050473862', '여', NULL, NULL, 6, NULL, 17, '2019-10-02 17:15:59', NULL, '1', 'N'),
(61, '김동희', NULL, '', 1, 3, '', '', '여', NULL, NULL, 9, NULL, 17, '2019-10-02 17:16:13', NULL, '6', 'N'),
(62, '조병준', '게임을 좋아함 - 롤이라는 게임 다이아몬드 <br/>(아이언 - 브론즈 - 실버 - 골드 - 플래티넘 - 다이아몬드 - 마스터 - [그랜드 마스터 - 챌린저]이 부분은 프로게이머 정도 생각하시면 편함.  )<br/>실기가 1월 22일에 있음. 1/11월 통화 해보았더니 롤 아이디는 친구한테 맞기고 실기 연습 하는 중.<br/>순모임 가운데 바빠서 말씀을 읽지 못한다 하였지만. 게임은 열정적으로 하던 친구.<br/><br/>1.24 / 23일 여주대 시험은 나름 만족 함, 화요일, 금요일 실기 2개 남음 / 백석, 국제 실용음악과.<br/>주일학교 출신이여서 지식은 많으나. 세상의 가치관으로 많이 이야기 함. <br/>3.3 / 학교 다 떨어지고, 유튜브, 온라인 앨범 발매, 준비. 군입대 준비 <br/>5.10/알바 하고 있는데, 일 잘해서 계속 다른데 일손을 많이 돕고 있음, 또 필립이 주식이야기 들으며, 돈에 대한 마음이 더욱 커져감.', '', 1, 3, '', '01023215843', '남', NULL, NULL, 2, NULL, 17, '2019-10-02 17:16:22', NULL, '1', 'N'),
(63, '한상은', NULL, '', 1, 3, '', '', '여', NULL, NULL, 6, NULL, 17, '2019-10-02 17:16:32', NULL, '3', 'N'),
(64, '정성화', '주중에 온라인으로 친구와 만나 게임을 한 듯합니다.<br/><br/>초등부에서 반을 맡게되어서 조금은 당황했지만, 열정으로 친구들의 번호를 수집하고 심방.<br/><br/>3.25 / 기숙사 생활로 다시 많이 어려워 졌지만, 잘 참여해줌 <br/>신앙에 대해서는 그저 하나의 지식,교훈으로 여김 , 같이 주일학교 놀던 친구들 중 한 친구의 상황에 많이 어려워하고, #001신이 있나?#001 라는 생각을 품고 있음<br/>5.10 / 지난주 주일에 자택으로 올라왔지만 기숙사라 거짓이야기 하며, 집에서 온라인 . 온라인의 단점!', '', 1, 3, '', '01089662842', '남', NULL, NULL, 3, NULL, 17, '2019-10-02 17:16:43', NULL, '1', 'N'),
(65, '이재은', NULL, '', 1, 3, '', '', '여', NULL, NULL, 8, NULL, 17, '2019-10-02 17:16:52', NULL, '6', 'N'),
(66, '김아진', '현준이에게 전해들은 내용 : 유치원이 원장의 독단 하에 영어 유치원으로 바꾸려 하기에 선생님들에게 수업시간 중 몇 시간씩 영어로 진행하라고 이야기 함으로 .. 유치원 몇몇 선생님들은 소송 준비중 / 민혜 누나도 배울꺼 없다고 옮기라고 했다고...? 전해들음.<br/>제가 알기로는 이미 이직 준비를 하고 마친거로 알고있음.<br/><br/>요즘은 가정 가운데에서 조금은 많이 너그러우신지 잘 참여하고 있음, (20년도 11월 후반 부터 많이 어려워 했음..)<br/>1.24 / 이사 가기로 했던 집 이전에 임시 거처 로 인해서 집정리  순모임은 목요일 저녁 + 코로나 2.5 단계로 교회는 아직 가지 말라하심.<br/>3.3 / 많은 지체들의 연락이 왔었지만, 스스로 삶에 지침으로 연락이 느렸음(2~3일에 1번 할까? 말까?), 지체들을 보고 싶지 않음, 허나 애써서 나옴<br/>3.25 / 부모님과 다투고 싶지 않다고 고백함.<br/>5.10 / 현준이와의 관계 .. 잘이어가지 못하는 듯함. , ', NULL, 1, 3, '990801', '', '여', NULL, NULL, 3, NULL, 17, '2019-10-02 17:16:59', NULL, '1', 'N'),
