(69, '조송연', '1.24.<br/>이번 주 팀리더모임 중에 송연이의 마음을 많이 느꼇습니다. 영혼을 향한 사랑과 열정<br/>+ 최근에 뚜쥬에 확진자가 다녀갔다는데 송연이 알바 시간은 아니라합니다. 허나 정인이 는..? <br/>가족의 재정문제에 있어서. 조금은 어려움, 직장인 대출 연장 때문에 직장을 구해야함.<br/><br/>밭 비유 가운데 가시떨기 밭임을 알고 해설을 보면서 #001하나님은 나를 그냥 두시지 않으신다#001 라는 것을 많이 느낌.<br/>+ 지연누나가 계속해서 일대일을 계속 권유<br/>혜림이를 보면서 많이 느낌.<br/><br/>계속해서 말씀 가운데 스스로 많은 부분을 내려두고 개선? 되는중. 성화<br/><br/>3.25 / 월,화 - 뚜쥬 마감 알바 / 새가족 순공부 하지 못함으로 고민 중 해냄누나와 이사야 공부(격주 일요일 저녁) / 사무직 알바 (화 오전 / 목금 오후)<br/>', '', 1, 3, '', '01023405843', '여', NULL, NULL, 4, NULL, 17, '2019-10-02 17:17:23', NULL, '1', 'N'),
(70, '김규린', '일하고 있으며, 최근에 경건이 많이 무너졌으며, 동기들과 같이 하던 필사도 밀림.<br/> <br/>순 전체적으로 같이 경건생활을 세우고자 함.<br/><br/>3.3 / 뽀로로 와 같은 친구. 노는게 제일 좋다고 고백 / 편입 준비<br/>계속해서 말씀에 대한 찔림은 있으되 나아가지 못함<br/>3.25 / 편입 준비 계속 준비하고 있으며, 4월 부터 재택근무로 전환<br/>_ 지난 주 부터 한 주에 영상 1~2개 분량<br/>5.10 / 지난주 친구랑 부산 ? 대전? 가서 열심히 놀고 온 후에 몸살을 얻어 오심. (신애,송연 과 함께 하는 책모임 안에서 솔직히 잘 누리기를.)', '', 1, 3, '990921', '01028050368', '여', NULL, NULL, 3, NULL, 17, '2019-10-02 17:18:16', NULL, '1', 'N'),
