(73, '정희진', '한 달간 알바로 인해서 2부 순서는 하지 못함<br/>+ 15일 에 은서 순장 만남<br/><br/>전 남자친구 다시 만나고 있음. (13일 은서 통해서 들음)<br/>가정의 상처들과 아픔들..이 큼<br/>3.25 / 이번주 주일 친구와 여행 다녀온듯.(인스타 참고함)<br/>5.10/ 가정에서도 부모님, 교회에서도 친척.. 세은이네 많은 눈길들을 소식들이 들어가는 것이 힘듦,', '', 1, 3, '', '01085662188', '여', NULL, NULL, 2, NULL, 17, '2019-10-02 17:18:41', NULL, '1', 'N'),
