(77, '김준서', '코로나로 인한 교회에 대한 인식이 좋지 못해서, 나오지 않음. 이라고 하네요.. <br/>작년에도 범혁이가 알려줬었는데.. <br/>지금은 연락이 안 닿습니다.<br/><br/>4.10 / 형섭이랑 같이 알바 하다가 군입대 문제로 알바를 그만 둔 것 같음', '', 1, 3, '001004', '01085536076', '남', NULL, NULL, 2, NULL, 17, '2019-10-02 17:19:17', NULL, '2', 'N'),
