(80, '이동현', '회복 하는 듯 했으나?<br/>다시 주식을 하는 건지 .. 계속 꾸준히 해 온건지.. 최근에는 100만원 수익이 났다고 많이 기뻐함..<br/>돈, 상처 가 제일 어렵지 않나... (인정하지 않음.)<br/><br/>1.24 / 팀 리더모임 가운데, 은서 순장이 - 동현오빠는 솔직하지 않은거 같습니다. 라고 말함..ㅎㅎ..<br/>가정이 제일 힘든 친구.. <br/><br/>이전에 받은 공동체의 아픔들.. <br/>심적인 공포가 큼.<br/>+ 최근에 한 지체가 힘들게 함..<br/><br/>3.3 / 지난주 화요일 부재, 토요일 부재, 계속된 혼남.... 안타까운 영혼.<br/>3.25 / 지난주에 우울증 진단을 받고 약을 먹고 있다. 알려줌<br/>5.10/정결한 심령을 구해야 한다 이야기를 했는데.. 음.. 다른 부분이 부족할지 언정, 하나님 앞에서 잘 서있기를', NULL, 1, 3, '950104', '01072523088', '남', NULL, NULL, 7, NULL, 17, '2019-10-02 17:19:40', NULL, '1', 'N'),
