(82, '김기준', '삼성?? 에서 덕트 공사 하고있음<br/>일당 17만원 숙식제공 6개월간 창업자금 마련이 목표(음식)<br/>오전 5시 출근 오후 6시 퇴근 숙소 도착 7~8시.<br/>온라인 예배 드리고 있으며, 호연순장과 1:1 ?? ', '', 1, 3, '', '01049205059', '남', NULL, NULL, 7, NULL, 17, '2019-10-02 17:19:55', NULL, '2', 'N'),
