(84, '조동현', '회복에 힘쓰고자 하고 있으며, 매일 큐티를 하고 있다고 이야기 함.<br/>또 온유 순장이 감동했다는데... 성화와 주영이의 캐미 로 게임이야기로 빠질 뻔 한걸 잘 중재해주었다고 하네요..<br/>1.24 자신의 연약함에 집중. / 많은 나눔. 많이 밝아짐. 모순이 많음.. 지식의 자랑, 자신에 대한 화<br/>명도, 세희, 다윗, 호연 등 형제들이 연락을 기대하지만 안온다고 화냄... ㅎㅎ<br/><br/>3.25 / 예배가 잘 안지켜 지는 것 같음. 돌아오는 호연 순장과 주일 만남<br/>휴학<br/>5.10 / 예배를 안나오다가, 나오고 있는데, 계속해서 마스크를 쓰지 않으며, 음료를 챙겨오는 중.. 기도하고 .. 이야기를 해야함. <br/>또 연애를 하는 듯함. 고등부 친구랑..', '', 1, 3, '', '01053333895', '남', NULL, NULL, 5, NULL, 17, '2019-10-02 17:20:11', NULL, '1', 'N'),
