(86, '박주하', '12월 입사 부터 2주간 온라인 연수를 받았으며, <br/>(1/11) 월요일 부터 출근 (삼성반도체)<br/>하나님에 대한 마음이 많이 식었음을(예배도 동일) 12월에 호연순장과 식사중에 나누었음. 계속 은서 순장이 독려 .<br/>1.24 / 용인 자취 오피스텔 500/35? 구해서 지냄. 1:1은 안하는 것으로 결론 남. 아직도 마음은 많이 열리지 않음.<br/>', NULL, 1, 3, '961203', '01041783675', '남', NULL, NULL, 6, NULL, 17, '2019-10-02 17:20:26', NULL, '1', 'N'),
