(94, '박지훈', '3월에 집 이사는 확정 / 이틀에 한 번씩 은서 순장이 심방을 하고 있음<br/>부담을 느낄 수록 반응하는 지체.. (사랑에 대한 반응 확실)<br/>14일붙버 진올(김용우 집사님 회사 알바중)<br/>1.24 / 순모임 불참 사유, 피곤해서..<br/>3.3 / 어제 3.2날자로 이사 함.<br/>3.25 / 이사 + 기숙사 생활로 순모임을 많이 기피하고 있음, 4명의 친구(조동,형진,정현) 과 함께 예배 불참<br/>4.17 / 기숙사 룸메 생겼는데 카페에 가서 순모임 참여.<br/>5.10 / 계속해서 나가려하지만 또 이야기 하면 너무나 잘 들어주는 친구, 또 하나님을 향한 갈망함이 있으며, 그 안에서 하나님의 사랑을 받고있지만 인지하지 못함.', '', 1, 3, '', '01023003328', '남', NULL, NULL, 5, NULL, 17, '2019-10-02 17:21:44', NULL, '1', 'N'),
