(106, '최은서', '은서 는 많이 애 쓰고 있지요..<br/>오늘도 하나님이 나에게 부정적인 생각을 주시지 않으시지? 라는 질문 같은 것을 하지만..<br/>그럼에도 잘 이야기 나누고 받아내고자 하고있습니다.<br/><br/>1.24 어머니와 순모임 후 다툼, 머리 정리해라, 옷 잘 입어라, 살빼라 등등.. 자존감이 낮음으로 엄청난 스트레스.. 고통. / 자취 할 예정. (회사로 인해서)<br/>3.3 / 5월에 광명 아파트로 이사, 많이 힘겨워 하고 있음( 직장, 가정, 본인의 삶에도 애씀)<br/><br/>5.10/이사 완료! 은서의 속사람이 점점 강성해 지기를 ', '', 1, 3, '', '01048493966', '여', NULL, NULL, 5, NULL, 17, '2019-10-02 17:28:55', NULL, '1', 'N'),
