(135, '하승원', '학교 졸업 요건 채우기와 취업 준비로 인해 군대에서 자격증 공부를 엄청 하고 있습니다. 경건은 하고 있는데 본인도 형식적인 것 같다 말하는 것 처럼, 경건의 형식만 있는 거 같습니다. <br/>지난주 토요일에 통화 하며, 세속주의에 대한 부분과 교제 이야기 등등 여러 이야기 나누었습니다. <br/><br/>최근에는 재은이가 요한이형 한테 승원이 상태가 안좋다고 연락 좀 해달라고 했다고 합니다. <br/><br/>승원이 상태가 좋지 않아 둘 사이도 조금 어려운 것 같습니다. ', '', 1, 9, '990222', '01037392682', '남', NULL, NULL, 4, NULL, 16, '2019-10-04 06:19:46', NULL, '4', 'N'),
(136, '황요한', NULL, '', 1, 9, '900315', '01023456624', '남', NULL, NULL, 12, NULL, 16, '2019-10-04 06:21:16', NULL, '6', 'N'),
(137, '서유리', '공무원 공부(4월 시험)<br/>요즘 경건생활은 그저 그런 것 같습니다. 지체들과의 연락도 오는 연락만 받고 있는 상태고.<br/>학원 보강 때문에 예배 못드리는 경우가 있는데 그 때 따로 예배는 드리지 않았다고 하네요. 앞으로는 링크 보내줄 테니 예배 못드리는 경우에 주일에 꼭 따로 드리라고 했습니다.<br/><br/>보강이 없어서 주일예배는 요즘 참여하고 있는데 순모임을 조금 피하는 느낌이 듭니다. 저번에는 성국이를 만나기로 해서 못했고, 이번주는 연락이 안되다가 예배 후에 집에 가는 길이라고 연락이 와서 도착하는 대로 줌 들어오면 된다고 했는데 안들어왔습니다..', '', 1, 9, '', '01045740142', '여', NULL, NULL, 7, NULL, 16, '2019-10-04 06:21:25', NULL, '1', 'N'),
(138, '정주원', NULL, '', 1, 9, '941121', '01094493275', '남', NULL, NULL, 8, NULL, 16, '2019-10-04 06:21:33', NULL, '6', 'N'),
(139, '김현준', '최근 3주간 아진이와의 관계에 어려움을 느끼고 있습니다. 아진이가 경건이 잘 세워지지 않고 하나님과의 관계가 멀어져서 둘 사이에 신앙을 나누는 부분도 잘 되지 않았고 아진이가 그런 이야기 하는 것을 피한다고 했습니다. 그래서 현준이가 저랑 요한이형 명도형 최근에는 사모님도 만나서 많은 이야기 듣고 아진이를 용납하고 하나님의 사랑으로 사랑하는 것과 하나님 앞에 자신의 의를 내려놓는 연습을 조금씩 하고 있는 거 같아요.<br/>많이 힘들어서 그런지 기도도 많이 하고, 다행히 이번에는 형들의 조언을 잘 들어서 요즘은 아진이랑 그래도 조금씩 신앙 얘기도 되고 대화가 조금씩 되고 있는 거 같습니다. <br/>PS. 형들이 왜 어릴 떄 교제 하지 말라고 했는지 알거 같다고 하더라구요..ㅎㅎ 에베소서 공부하더니 목사님이 예전에 에베소서 공부하라고 하신 이유를 알것 같다고도 하고.. 형들이 해준 얘기가 여기 다 있다며..ㅎㅎ ', '', 1, 9, '', '01049395846', '남', NULL, NULL, 5, NULL, 16, '2019-10-04 06:21:42', NULL, '4', 'N'),
