(177, '이주안', '공군 평택 7전대 자대 배치(21.1월)<br/>간부 10정도 있는 사무실에서 병사는 주안이 한명이라고 합니다. 행정업무 하는데 대부분 간부들이 다 해서 주안이는 할 게 없다고 하네요. <br/>군대에서 더 밝아지고 활발해진 거 같습니다. 최근에는 탁구에 빠져서 부대 사람들이랑 탁구 많이 치고 있다고 하네요. <br/>부대 사람들은 다들 착하고 서로 친구처럼 지내는 분위기라고 합니다. <br/>전대 내에 교회가 크기는 작지만 수요일마다 모임을 갖는데 지난번에 처음으로 참여해서 치킨도 먹고 했다고 하네요. ', '', 1, 9, '', '01032533862', '남', NULL, NULL, 4, NULL, 32, '2019-10-06 10:19:13', NULL, '4', 'N'),
