(212, '최주현', '- 유년 시절부터 동성교회 출석<br/>- 가족 모두 동성교회 다니고 있음 (최주희, 최민호)<br/>- 유치부 교사로 오랜 기간 섬기고 있음<br/>- 2015년 LTC 상반기 수료 후 리더로 섬기고 있음<br/>- 오랜 시간 신앙생활을 해왔지만 말씀에 대한 깊이가 약하고 감정에 영향을 많이 받아 기복이 있음.<br/>- 영적으로 더욱 성숙해야하는 신앙상태', '', 2, 7, '', '01023270178', '여', NULL, NULL, 17, NULL, 3, '2019-10-10 16:42:52', NULL, '1', 'N'),
(213, '손세훈', '- 반도체 회사에서 근무중 (이천)<br/>- 예배는 항상 성실하게 오고 있으나 좋은 말씀정도로 받고 있음<br/>- 편입, 취업 준비 중 필요가 있을 때 하나님을 더 가까이 찾게 되는 것 같음.<br/>- 예전에 신천지 교육을 받을뻔 했는데 조기에 알게 되었던적이 있음', '', 2, 7, '', '01071763436', '남', NULL, NULL, 11, NULL, 3, '2019-10-10 16:43:02', NULL, '1', 'N'),
(214, '신은경', '[3.26]<br/>이전에 하던 프로그램에서 갑자기 해고 통보 받고 마음이 어려웠으나, 다른 프로그램으로 이동하게 됨.<br/>저녁 라디오 방송으로 가게 되어서 오후 출근.  <br/><br/>- 은행팀 현사라 자매 전도로 1청 때 오게 되었음<br/>- 집은 분당 거주<br/>- 2013년도 LTC를 수료했으나 리더로 세워지진 않았음<br/>- MBC 라디오 작가 <br/>- 1청 때는 공동체에서 나름 활동을 했으나 2청이 되고 난 후 하나님을 깊게 만나지는 못해 신앙에 대해 아직 큰 변화가 있지는 않음<br/>- 좀 더 깊이 있고 분명한 신앙이 심겨지길 소망함.. ', '', 2, 7, '', '01093076131', '여', NULL, NULL, 1, NULL, 3, '2019-10-10 16:43:09', NULL, '1', 'N'),
(215, '천병현', '- 고등부 때와 청년부 초기 열심이 있었으나 어느 시점 교회에 상처가 있었던 것으로 알고 있음.<br/>- 편입으로 세종대 애니메이션과에 들어갔으나 졸업을 하진 않았고 현재는 미술학원 강사로 근무 중.<br/>- 한동안 사랑의 교회에 출석했었고 2015년정도(?) 부터 청년부 예배 다시 오게 되었음', '', 2, 7, '', '01033661986', '남', NULL, NULL, 16, NULL, 3, '2019-10-10 16:43:19', NULL, '1', 'N'),
