(217, '조민수', '- 조민수, 조은수, 조아혜와 남매<br/>- 가족 동성교회 출석<br/>- 아직 신앙이 없고 부모님의 권유로 오게 되는 상황<br/>- 호주 워킹 홀리데이로  1-2년간 해외 생활<br/>- 고정적인 직업없이 계약직, 아르바이트 근무 하는걸로 알고 있음', '', 2, 7, '', '01055510590', '남', NULL, NULL, 12, NULL, 3, '2019-10-10 16:43:43', NULL, '2', 'N'),
