(224, '김광진', '- 유아 시절부터 동성교회 출석<br/>- 정신과 치료를 받고 있고 현재(~2021) 작업장에서 근무<br/>- 남양주에 거주 <br/>- 은행팀 김동진의 형', '', 2, 7, '', '01094523865', '남', NULL, NULL, 1, NULL, 3, '2019-10-10 16:44:45', NULL, '1', 'N'),
