(226, '황세영', '- 정감마을에 엄지윤 자매 통해서 동성교회에 오게 되었음<br/>- 장애가 있는데 심한 정도는 아님<br/>- 고려대학교 학생식당에서 근무중 (아워홈)<br/>- 집은 의정부에 거주 중<br/>- 예배가 지속적이지 않고 상황이나 마음에 따라 많이 변경이 있음', '', 2, 7, '', '01037867464', '여', NULL, NULL, 11, NULL, 3, '2019-10-10 16:44:59', NULL, '1', 'N'),
