(229, '길장미', '- 고등부 시절부터 동성교회 출석<br/>- 대학교 시절 ccc 활동, 청년부에 출석하지 않았음<br/>- 대학 졸업 후 다시 오게 되었는데 공백 기간이 있어 적절한 양육을 받지 못함<br/>- 청년부에 다시 와서도 경찰 공무원 시험준비로 예배, 순모임 등 정기적인 참석이 어려웠음<br/>- 현재(2021) 경찰 합격했고 중경학교에서 교육 중 (2021.6월 정도 나올예정)<br/>- 교제하는 형제 있음<br/>- 중경학교 수료 / 학교에서는 예배를 거의 못 드림<br/>- 수료 후 현장 배치', '', 2, 7, '', '01062045804', '여', NULL, NULL, 10, NULL, 3, '2019-10-10 16:45:21', NULL, '1', 'N'),
