(233, '남윤성', '- 고등부 때 나오다 청년부가 되고 한동안 예배를 드리지 않았었는데 2019년 정도부터 다시 나오게 되어서 그 이후로 꾸준히 예배 참석<br/>- 공동체에 들어오고 싶은 마음과 하나님에 대한 갈급한 마음이 있었는데 코로나 시기가 오면서 뒤로 물러나는 느낌이 있음<br/>- 졸업한 남윤민 형제 동생.<br/>- 아버지가 돌아가셨음<br/>-현재(2021)는 콜센터 업무 하고 있음', '', 2, 7, '', '01031174063', '남', NULL, NULL, 14, NULL, 3, '2019-10-10 16:45:57', NULL, '1', 'N'),
(234, '김성아', '[2021/01/17]<br/>- 대면이 재개 되도 청년부 예배는 어려울 것 같다 전함. <br/>- 최근 교회 연말 정산에 교인 등록이 안되어 있었는지, 조회가 안되어 교회에 대해 어려운 마음을 표현하였음 (보람이 통해 듣게 되었어요)<br/><br/>[기본 인적 상항] <br/>- 가족 모두 동성교회 출석<br/>- 2015년 상반기 LTC수료 ~ 2016년까지 순장 <br/>- 청년시절 교회를 다니지 않다가 다시 오게 되어 새가족순부터 수료하였고 리더로 섬기다 현재(2021)는 나이와 마음의 어려움이 있어 청년부 예배를 드리지 않고 있음', '', 2, 7, '', '01028424417', '여', NULL, NULL, 19, NULL, 3, '2019-10-10 16:46:04', NULL, '1', 'N'),
(235, '김보람', '[2021/01/22]<br/>-5/1일 결혼, 군산에서..<br/><br/>[2021/01/17]<br/>- 순모임 참여에 마음이 어렵다고 전하여서 예배만 드리고 있는 상황<br/>- 31일 이후에 청년부 예배는 가능하다고 전해주었어요.<br/><br/>[기본 인적 사항]<br/>- 본가는 군산, 중곡동 자취 중 동성교회 출석<br/>- 공예 사업가 (성수동 작업실)<br/>- 작업 등 군산과 서울을 오가는 일이 많아 주중에 바쁜 스케쥴<br/>- 현재(2021) 군산에 있는 형제와 교제중', '', 2, 7, '', '01051765418', '여', NULL, NULL, 1, NULL, 3, '2019-10-10 16:46:11', NULL, '1', 'N'),
