(239, '박지영', '- 본가는 광명, 직장 때문에 중곡동에 오게 되었음<br/>- 은행팀 박지혜 자매와 자취하고 있음<br/>- 2019 LTC 하반기 수료 ~리더로 섬기는 중<br/>- 어린이집 교사<br/>- 대학생 때 IVF동아리 활동을 했고 김건 소개로 동성교회 출석함<br/>- 2021 재정국장<br/>- 아버지 실직하여 구직 중', '', 2, 7, '', '01099199942', '여', NULL, NULL, 10, NULL, 3, '2019-10-10 16:46:43', NULL, '1', 'N'),
(240, '김동진', '2021년 1월<br/><br/>-공동체를 어려워 하는 마음은 있음, 순모임은 참석하지 있지 않음<br/>-그래도 은행팀 단톡방에는 초대되어 들어와 있음', '', 2, 6, '', '01027029680', '남', NULL, NULL, 12, NULL, 2, '2019-10-12 18:50:28', NULL, '1', 'N'),
