(244, '양경모', '2021년 1월<br/><br/>-최근에 돈까스집 개업(구의동)<br/>-2월에 구의동으로 이사올 예정<br/>-최근에 은경이에 약간의 호감을 마음이 있다고 말했음(현민, 사라에게)<br/><br/>4월<br/>일대일 시작(현민)<br/>반복되는 삶을 살고 있어서 다소 힘들어함..<br/><br/>2월<br/>-2/8일 이사(구의동-  돈까스집 근처)', NULL, 2, 6, '', '', '남', NULL, NULL, 17, NULL, 2, '2019-10-12 18:51:07', NULL, '1', 'N'),
