(248, '현사라', '2021년 1월<br/><br/>-여전히 머물러 있는 마음이 있음. 예배는 드리고 하지만 주중의 경건생활은 잘되지 않음<br/>-경모형의 은경이에 대한 호감표현으로 다소 경모형을 어려워 하는 마음이 생김', '', 2, 6, '', '01047689686', '여', NULL, NULL, 1, NULL, 2, '2019-10-12 18:51:45', NULL, '1', 'N'),
