(250, '윤현재', '2021년 1월<br/><br/>-임용고시 떨어지서 2월까지 사립으로 넣어 보는중 -> 아마도 올해도 계속 공부를 할 예정<br/>-예배는 주로 대예배를 드리고 있음<br/>-이사예정<br/><br/>4월<br/>-이사 4층->3층<br/>3월<br/>-당곡고등학교 고2체육선생님(일주일에 화 목 나감)<br/><br/><br/>2021년 3월<br/>-당곡고등학교 2학년 체육교사로 취업<br/><br/>2월<br/>-느혜미야의 공부를 돌아보며 자신의 기도가 세속적이 었음을 많이 느끼고 있음(ex. 자신의 것을 구하는 기도)', '', 2, 6, '', '01092099215', '여', NULL, NULL, 10, NULL, 2, '2019-10-12 18:52:09', NULL, '1', 'N'),
