(301, '김진웅', '진웅이는 인턴으로 일을 하고 있는데 요새는 점점 연락이 안되고 있습니다..<br/>말씀에는 묵묵부답이며 가끔 편의에 따라 답장을 해줍니다. 회사는 야근을 안해서 잘 다니고 있는데 모든 공동체 적인 부분에서 소극적입니다.<br/>그래도 연말 언약팀모임에는 참여를 해서 본인 상황과 나눔은 잘 해주었습니다.<br/><br/>일이 요새 많이 바쁘다고 합니다. 그래도 회사일은 나름 할만하며 야근은 절대 안시킨다고 합니다. 그 외 교회 얘기하면 갑자기 답장이 잘 안돼서<br/>조심스럽습니다.(2021.02.22기준)', '', 1, 2, '', '01025278049', '남', NULL, NULL, 6, NULL, 11, '2019-10-25 02:21:44', NULL, '1', 'N'),
(302, '이성우', NULL, NULL, 1, 2, '', '', '남', NULL, NULL, 13, NULL, 11, '2019-10-25 02:21:51', NULL, '1', 'Y'),
