(304, '이가은', '일대일양육자-김나영<br/>- 가은이는 필사모임으로 함께 하고 있어서 따로 연락을 자주 하지는 않았습니다. 말씀 안에서 하나님을 묵상하며 나누는 부분이 귀합니다.<br/>더 많이 교제하며 나누는 시간이 있으면 좋겠습니다.(일대일)<br/><br/>- 나영이와 일대일 매칭이 되어 은혜롭게 잘 교제하고 있으며 최근에는 범혁형제와 일대일로 영어공부를 줌으로 하기로 한 모임에 박요한 형제도 같이 하기로 되었다고 합니다.<br/>퇴근 후 일주일에 한번 30분씩 진행하는데 힘이 들지만 그럼에도 공동체에서 받은 사랑을 이렇게나마 전할 수 있다는 것에 감사하며 하려고 한다고 합니다.(2021.01.28기준)', '', 1, 2, '', '01051170692', '여', NULL, NULL, 7, NULL, 11, '2019-10-25 02:22:11', NULL, '1', 'N'),
(305, '이은혜', '회사 사정상 현재 일을 쉬고 있습니다. 주일 예배는 빠짐없이 잘 드리고 있으며 연락이 바로바로 되는 편은 아니지만 그래도 잘 연락하며 지내고 있습니다.(2021.01.11기준)', '', 1, 2, '', '01064813997', '여', NULL, NULL, 7, NULL, 11, '2019-10-25 02:22:17', NULL, '1', 'N'),
(306, '김예림', '알바를 하며 지내고 패스트푸드 점 외에 미용실 알바를 구하고 있다고 합니다. 주일에도 알바 하는 날이 많아 예배가 잘 되어지지 않습니다.<br/>그래도 공동체에 어려움이나 불편함 없이 잘 참여하려는 마음은 있습니다.', '', 1, 2, '', '01054308252', '여', NULL, NULL, 7, NULL, 11, '2019-10-25 02:22:23', NULL, '1', 'N'),
(307, '우혜원', NULL, NULL, 1, 2, '', '', '여', NULL, NULL, 5, NULL, 11, '2019-10-25 02:22:31', NULL, '1', 'Y'),
(308, '이소정', '연락이 안됩니다. 다희 친구라 다희랑 먼저 연락해보고 관계가 쌓이면 물어보겠습니다(2021.01.11기준)', '', 1, 2, '', '01087107931', '여', NULL, NULL, 7, NULL, 11, '2019-10-25 02:22:37', NULL, '2', 'N'),
