(318, '정한나', NULL, '', 1, 2, '', '01049040535', '여', NULL, NULL, 6, NULL, 11, '2019-10-25 02:24:16', NULL, '1', 'N'),
(319, '이혜림', '일대일양육자-유지연<br/>- 현재 방학이라 서울에 올라왔고 화-토 갤러리에 출근합니다. 학교에서 연결된 곳이며 방학마다 꾸준히 하고있습니다. 근무환경이 좋아 마음 어렵지 않게 다니고 있습니다.<br/>올해 4학년이라 학교 내에서 세상적인 진로에 대한 고민이 많습니다. 또 학교로 돌아가면 미술 작업, 수업, 과제, 졸업작품 전시 등으로 일정이 많아 바쁠 예정이며 바쁜 일상속에서 어려워 할때가 많습니다.<br/>그래도 일대일을 하며 경건에 힘쓰고 있으며 리더경건생활표를 동일하게 서로 공유하고 있습니다. 일상에서도 말씀에 순종하려 힘쓰며 이전과는 다르게 하나님이 만져가시는 것 같습니다. (2021.01.06기준)<br/><br/>- 일대일에서 함께 나누며 기도하는 시간 을 통해 혜림이가 주님 안에서 누리고 채워주심을 느끼게 됩니다. 고백들이 감사합니다.(2021.01.28기준)', '', 1, 2, '', '01029249140', '여', NULL, NULL, 3, NULL, 11, '2019-10-25 02:24:27', NULL, '1', 'N'),
(320, '정은혜', NULL, '', 1, 2, '', '01050060545', '여', NULL, NULL, 3, NULL, 11, '2019-10-25 02:24:32', NULL, '1', 'N'),
(321, '강유라', '장거리 남자친구가 있으며 세상적으로 교제를 하고 있습니다. 예배에 대한 마음도 시험기간이라는 말로 기피합니다.<br/>학교에서 체플도 하고 말씀과 예배를 드릴때도 있지만 형식적으로 듣고 안일하게 생각하며 지내고 있는 상태인것같습니다.(2021.01.06기준)', '', 1, 2, '', '01075297290', '여', NULL, NULL, 3, NULL, 11, '2019-10-25 02:24:37', NULL, '2', 'N'),
(322, '김도희', '회사 직원생활에 종교시설 방문 금지라 교회를 못가기도 하고 병원이라 감염관리를 심하게 하고 있어 사적모임도 금지라 친구들도 못만나고 있다고 합니다.<br/>일개 사무직이라고 하고 어디서 뭘 하는지 물어보진 않았습니다. 주일 예배는 유튜브로 참여한다고 말했는데 아직 확인해보진 않았습니다.<br/>예배 참석이 가능할때 가서 찾아뵙고 인사한다고 합니다..(2021.01.28기준)', '', 1, 2, '', '01029638619', '여', NULL, NULL, 6, NULL, 11, '2019-10-25 02:24:43', NULL, '2', 'N'),
(323, '박규리', NULL, NULL, 1, 2, '', '', '여', NULL, NULL, 3, NULL, 11, '2019-10-25 02:24:49', NULL, '1', 'Y'),
(324, '박은화', NULL, '', 1, 2, '', '', '여', NULL, NULL, 6, NULL, 11, '2019-10-25 02:24:56', NULL, '2', 'N'),
(325, '최혜리', '- 아버지가 건강이 안좋으셔서 수술 날짜를 잡고 있다고 합니다.(아직 자세하게는 물어보지 않았습니다.)<br/>말씀을 전하고 싶은 마음이 많이 들어 주일 말씀을 꼭 들어보라고 권면하고 있습니다.<br/>혜림이와 지수,규린까지 4명은 평소에도 관계를 잘 지켜오고 있습니다. <br/><br/>- 1월말까지 학원과 시험이 있어 끝나고 순모임과 예배에 참여하겠다고 합니다.(2021.01.28기준)<br/><br/>- 며칠 전 학교 졸업식을 했습니다. 3월부터는 일본으로 가기 전 알바를 한다고 합니다. 강남역 안과 코디로 일하며 수,일 휴무입니다.(2021.02.22기준)', '', 1, 2, '', '01032759394', '여', NULL, NULL, 3, NULL, 11, '2019-10-25 02:25:02', NULL, '2', 'N'),
(326, '이윤호', '방학기간 중에 새벽6-11시 도시락 포장 단기알바(학교급식 배달용)를 끝내고 바로 진올에 평일 알바를 시작했습니다. 그외에 전부터 꾸준히 해오던 다이소 화 목 토 알바도 병행하고 있습니다.<br/>피곤해하고 균형이 틀어질 수 있어 경건을 놓치지 않는지 물어봤을때 아침마다 말씀과 큐티를 꾸준히 하고 있어서 괜찮다고 합니다. 2021.01.28기준', '', 1, 2, '', '01056161453', '남', NULL, NULL, 3, NULL, 11, '2019-10-25 02:25:07', NULL, '1', 'N'),
(327, '최은석', '2021년도 1월부터 일을 쉬고 있으며 1월말까지는 현장근무를 나갑니다. 쉬면서 경건에 다시 힘쓰려 노력하고 있고 팀 동생들을 챙기려고 애쓰고 있습니다. (2021.01.06기준)', '', 1, 2, '', '01062879645', '여', NULL, NULL, 7, NULL, 11, '2019-10-25 02:25:12', NULL, '1', 'N'),
(328, '김현빈', '군대에 있지만 교회소식에 대해 답장이 잘 옵니다. 예배를 드리고 있다고 하는데 매주 잘 드려지는건 모르겠습니다.<br/>처음 연락하는거라 상황을 잘 모르겠고 코로나가 빨리 없어졌으면 좋겠다고 합니다. 군대에서 힘든 점은 없는지 물어봤을때 특별한 이야기를 나눠주지는 않았습니다.<br/>줌을 하고 싶지만 군대 내에서는 카메라 허용이 안돼서 참여가 어렵다고 합니다. <br/><br/>- 통화를 한번 길게 한 적이 있습니다. 카톡 외에는 처음 대화를 해본건데 그래도 말을 잘 들어줘서 주일 말씀과 은혜를 제가 많이 나누었습니다. 현빈이는 공동체에 기대함도 크게는 없지만 그래도 나쁜 마음도 없어서 잘 끌어주면 좋을 것 같고 더 열심히 해야겠다라는 마음도 든다고 합니다. (2021.01.28기준)', '', 1, 2, '', '01092512986', '남', NULL, NULL, 2, NULL, 11, '2019-10-25 02:25:18', NULL, '4', 'N'),
(329, '오하준', '하준이는 연락이 잘 안됩니다..<br/>전에 듣기로는 공동체에 대한 불편함이 있다고 해서 천천히 다가가고 있습니다..', '', 1, 2, '', '01063795488', '남', NULL, NULL, 2, NULL, 11, '2019-10-25 02:25:24', NULL, '1', 'N'),
(330, '정상현', '상현이는 계속 다른 순장들이 챙긴것같아 개인적인 연락은 자주 못했지만 마지막 요한순 소식으로는 점점 교회 모임과 비대면으로 인해<br/>많이 물러나고 어려워 하는 것 같다고 합니다..', '', 1, 2, '', '01074381106', '남', NULL, NULL, 6, NULL, 11, '2019-10-25 02:25:29', NULL, '1', 'N'),
(331, '강다희', '혼자 자취중이며 답장은 가끔 옵니다..최근에 통화했을 때는 일하며 지내고 나영이네 신혼집에 놀러가기로 얘기만 했습니다..(나영이랑 관계가 있어서 같이 먼저 보려구요)', '', 1, 2, '', '01064815756', '여', NULL, NULL, 7, NULL, 11, '2019-10-25 02:25:35', NULL, '2', 'N'),
(332, '박은서', NULL, '', 1, 2, '', '', '여', NULL, NULL, 6, NULL, 11, '2019-10-25 02:25:49', NULL, '2', 'N'),
(333, '이경민', NULL, '', 1, 2, '', '', '여', NULL, NULL, 9, NULL, 11, '2019-10-25 02:25:56', NULL, '6', 'N'),
(334, '지현빈', NULL, '', 1, 2, '', '01030917762', '여', NULL, NULL, 7, NULL, 11, '2019-10-25 02:26:16', NULL, '2', 'N'),
(335, '서정현', '서정현은 말이 많습니다. 말을 웃기게 잘하고 현재는 집에서 지냅니다.<br/>서일대 학교에 이번에 입학 하게 됬습니다.<br/>한형진이 서정현, 조동현에게 할거 없이 지내지말고 학교라도 넣어보라고 했다고 합니다.<br/>크로스핏?운동으로 한형진이 추천해줘서 살을 많이 뺐습니다.<br/>그 외에 박지훈이랑 게임방을 자주 가는 편입니다.<br/>', '', 1, 2, '', '01099695146', '남', NULL, NULL, 5, NULL, 11, '2019-10-25 02:26:22', NULL, '2', 'N'),
(336, '김세훈', '- 이번주까지 편입시험이 있습니다. 목이 계속 부어서 아파 병원을 병행하며 약을 먹고 있다고 합니다.<br/>카톡으로 대화가 잘 되며 말씀이 들어가기를 더욱 기도하게 됩니다. <br/><br/>- 편입결과를 기다리고 있으며 대학생활에 기대함을 두고 있는 것같아 걱정이 됩니다. 그래도 순모임 시간에 주시는 마음으로 잘 나누려고 하며<br/>관계의 폭이 좁아 공동체 안에서 더 함께 누리길 소망하게 됩니다.(2021.01.28기준)', '', 1, 2, '', '01089481784', '남', NULL, NULL, 5, NULL, 11, '2019-10-25 02:26:34', NULL, '1', 'N'),
(337, '정다혜', '요새 일이 너무 바빠 사람들 만나는 것을 기피하며 표현으로는 본인이 손절을 했다고 합니다. 가끔 만나 교제 할 때에는 환자 영혼들에 대한 마음을 주님의 마음으로<br/>잘 지켜 행하려고 애쓰는 나눔들을 많이 들었는데 요새는 많이 지쳐 마음이 좁아진 게 느껴집니다.<br/>예배는 주일에 오프인 날만 드리고 있습니다. ', '', 1, 2, '', '01088279310', '여', NULL, NULL, 6, NULL, 11, '2019-10-25 02:26:41', NULL, '2', 'N'),
(338, '박성인', NULL, '', 1, 2, '', '', '여', NULL, NULL, 8, NULL, 11, '2019-10-25 02:26:46', NULL, '6', 'N'),
(339, '함민영', '오랜기간 취업준비를 하였으며 얼마전 군자 부근에 콜서비스 마케팅팀으로 취업을 했습니다. 연락을 하면 답장이 잘 오는 편입니다.<br/>현재 왜 교회에 다녀야하는지와 예배에 나오지 않은 기간들이 길어지면서 귀찮음 등으로 예배가 되어지지 않고 있습니다.<br/>이전에 다녔던 직장에서는 관계적인 어려움이 많았으며 강유라와 자주 만나 교제하며 이야기를 나누는 것 같습니다.<br/>유라 민영은 꾸준히 만나며 유일하게 지내고 있는 상태입니다.(2021.01.06기준)<br/>', '', 1, 2, '', '01041418804', '여', NULL, NULL, 3, NULL, 11, '2019-10-25 02:26:53', NULL, '2', 'N'),
(340, '박수연', NULL, '', 1, 2, '', '01056054305', '여', NULL, NULL, 5, NULL, 11, '2019-10-25 02:26:59', NULL, '2', 'N'),
(341, '김수아', '현아를 통해 수아 번호를 물어봤는데 알려주기 싫다고 합니다..<br/>전에 몇번 현아랑 본 적이 있어서 괜찮을 줄 알았는데 마음이 닫혀 있는 것같습니다. 어떻게 지내는지는 아직 잘 모르겠습니다..', '', 1, 2, '', '', '여', NULL, NULL, 4, NULL, 11, '2019-10-25 02:27:05', NULL, '2', 'N'),
(342, '윤민지', '민지는..예배는 드리지 않을거지만 알려줘서 감사하다고 연락이 옵니다. 그 외에 반응은 딱히 없습니다..<br/>남자친구가 있어서 아직은 조금 어려울 것 같습니다만 기도합니다..', '', 1, 2, '', '01052320210', '여', NULL, NULL, 5, NULL, 11, '2019-10-25 02:27:10', NULL, '2', 'N'),
(343, '현지성', NULL, '', 1, 2, '', '', '남', NULL, NULL, 8, NULL, 11, '2019-10-25 02:27:16', NULL, '6', 'N'),
(344, '박요한', '', '', 1, 2, '', '01098931555', '남', NULL, NULL, 7, NULL, 11, '2019-10-25 02:27:23', NULL, '1', 'N'),
(345, '김용건', '용건이는 답장이 어쩌다 한번 옵니다..상황을 알 수 없습니다. 관계가 먼저 될 수 있길 바라게 됩니다<br/><br/>- 공동체에 대한 상처가 있는 것 같아 기도하게 됩니다. 그럼에도 답장을 줘서 감사했고 이번 다윗결혼식 가서 수빈이를 보면 잠깐 이야기 나눠 보려고 합니다.(2021.01.28기준)', '', 1, 2, '', '01093382395', '남', NULL, NULL, 2, NULL, 11, '2019-10-25 02:27:28', NULL, '4', 'N'),
(346, '김찬', '- 찬이랑은 초반에 연락을 하고 코로나 잠잠해지면 보기로 했는데 그 후로는 연락을 잘 안했습니다. <br/><br/>- 용돈벌이로 알바와 자격증(전기기능사) 공부를 병행하고 있으며 예배는 코로나 이후 잘 안가고 있다고 합니다.(2021.01.28기준)', '', 1, 2, '', '01040506382', '남', NULL, NULL, 3, NULL, 11, '2019-10-25 02:27:34', NULL, '1', 'N'),
(347, '한형진', '학교를 다니며 방학이라 집에서 시간을 보내고 있으며 평소에는 학업에 열중하고 있습니다. 체육과를 나와서 그런지 자기관리가 철저한 편입니다.<br/>교회를 기피하는 이유는 본인이 모르는 어른들의 시선과 먼저 다가와 인사하는 어른들에 대한 부담감이 있다고 합니다. <br/>현재는 집에서 온라인으로 예배를 드릴 수 있으니 집에서 예배를 드리고 권면하고 있으며 줌으로 언약팀모임, 1청새내기 환영회 등 자리를 지켜달라고 하면<br/>제 말을 잘 들어줍니다.<br/>근데 교회 나오라는 말이 싫다고 합니다..다른 사람들이 연락 오는 이유가 교회에 나오라고 하는 점이 어렵다고 해서 그 부분은 천천히 다가가고 있습니다(서정현도 마음은 동일)<br/>사람들에 대한 서운함..또 주일학교때부터 사랑이 없는 강압적으로 자신을 바꾸려고 하는 부분에 있어 조금 반감도 있습니다(서정현도 동일)<br/>서정현, 박지훈, 조동현, 한형진은 카톡방에서 자주 소통하고 지내며 여행도 다니고 서로 우정이 깊어 잘 챙겨주며 지내고 있습니다.', '', 1, 2, '', '01080348406', '남', NULL, NULL, 5, NULL, 11, '2019-10-25 02:27:40', NULL, '2', 'N'),
(348, '김현섭', '화-일까지 고기집(군자) 일을 하고있으며 알바가 아니라 직원이라 주말 휴무가 어렵다고 합니다. 요한이 말로는 먼저 뭐하냐고 가끔 연락이 오기도 하며 열려 있다고 합니다.<br/>먼저 연락 해주는 것도 좋아하며 공동체 안에서 많이 끌어주면 좋을 것 같습니다. <br/>윤호 요한이가 잘 챙겨주기로 했고 저도 월요일에 한번 보기로 하긴 했습니다만...<br/>', '', 1, 2, '', '01042820813', '남', NULL, NULL, 2, NULL, 11, '2019-10-25 02:27:46', NULL, '2', 'N'),
(349, '문병훈', NULL, '', 1, 2, '', '', '남', NULL, NULL, 9, NULL, 11, '2019-10-25 02:27:51', NULL, '6', 'N'),
(350, '임관일', '교회 소식으로 연락 오는 것에 대해 어려움 없이 잘 받고 있으며 예배는 주일에 지키려고 애쓰고 있는 것같습니다. 유튜브로 잘 보고 있으며 마음이 어려운 건 아니고 제 시간에 시청이 어려울 때가 있다고 합니다.<br/>저번주 설교도 끝까지 잘 봤다고 하며 아직 어렵긴 하지만 그냥 들었다고 합니다.<br/>공동체에 들어오는 모임까지는 아직 마음이 안된다고 하며 교회에서 풍기는 느낌이 단순하게 기도하며 소원비는 듯한..하나님을 알기위한 과정은 뭐가 오바되는 것같다..라고 나눠준 적이 있습니다. 무슨 뜻인지는 잘 모르겠습니다..<br/>주일을 넘기지 말고 예배를 지켰으면 좋겠다고 권면 하고 있습니다.', '', 1, 2, '', '01047357392', '남', NULL, NULL, 7, NULL, 11, '2019-10-25 02:27:57', NULL, '2', 'N'),
(351, '정상준', '올해 졸업반이며 건축학과라 5학년까지라고 합니다. 학교가 지방이라 계속 지방에서 지내고 있으며 답장은 친절하게 잘 옵니다. <br/>주말에도 작업, 일정등으로 참여를 못할 것같다고 연락이 오며 예배는 잘 안드려지는 것 같습니다..<br/><br/>- 오랜만에 서울집에 올라온다고 해서 순교재 전달 겸 만나기로 했지만 갑작스럽게 여자친구 만나러 부산에 갔다고 합니다. 주중에 연락이 잘 되는 편이고 거의<br/>주말에 여자친구를 만나느라 여자친구랑 안만나는 날에 예배나 순모임에 참여하는 것 같습니다.(2021.01.28기준)', '', 1, 2, '', '01025659604', '남', NULL, NULL, 6, NULL, 11, '2019-10-25 02:28:03', NULL, '2', 'N'),
(352, '조영신', '주일마다 예배를 드리고 있다고 합니다. 평소에는 10시 오전예배를 온라인으로 드리고 있으며 청년부예배도 링크를 보내주면 바로 들으려고 하고 있습니다.(인증샷으로 알려줄 때도 있습니다.)<br/>큐티를 하냐고 최근에 물어봤는데 안한다고 해서 같이 할 수 있도록 매일 보내주고 있으며 마음 어렵지 않게 말씀과 교회 소식들을 잘 받고 있는것같아서 감사합니다.<br/>주일에는 야구를 하러 다니고 평일에는 일을 하며 지내고 있습니다. <br/>', '', 1, 2, '', '01083244316', '남', NULL, NULL, 7, NULL, 11, '2019-10-25 02:28:09', NULL, '2', 'N'),
(353, '안민우', NULL, NULL, 1, 2, '', '', '남', NULL, NULL, 5, NULL, 11, '2019-10-25 02:28:23', NULL, '2', 'Y'),
(354, '김재선', NULL, '', 1, 2, '', '', '남', NULL, NULL, 8, NULL, 11, '2019-10-25 02:28:30', NULL, '6', 'N'),
(355, '7 홍진혁', NULL, '오성일', 1, 4, '191020', '', '남', NULL, NULL, 9, NULL, 41, '2019-11-03 19:33:52', NULL, '1', 'Y'),
(356, '이진아', '이전 김재선 형제를 통해 공동체에 오게 되었음<br/>헝가리에서 의대 공부 중 <br/>', '', 2, 7, '', '01046870721', '여', NULL, NULL, 14, NULL, 3, '2019-11-04 10:09:42', NULL, '3', 'N'),
(357, '이유진', NULL, '김명자집사님', 2, 8, '', '', '여', '2019-11-03', '2020-12-27', 13, NULL, 25, '2019-11-17 19:26:58', NULL, '5', 'N'),
