(376, '김민주', '게임을 좋아하는 친구. 최근에는 다른 이벤트로 애니메이션 5일 이용권을 얻어서 정주행 계획을 짜둠.<br/>1.24 계속 게임하면서 보내는 듯. 최근에는 자격증 공부를 하고 있음.<br/><br/>주일 예배 전 시간에는 연락 두절, 순모임은 평일에 최대한 하려 함.<br/><br/>4.17 시험기간 으로 예배 불참..<br/>5.10/ 팀모임 가운데 잘 참여해 주었으며, 조금은 친밀해 질 수 있었던 기회!', '', 1, 3, '', '01066061895', '여', NULL, NULL, 31, NULL, 10, '2019-12-29 00:24:58', NULL, '1', 'N'),
(377, '김한이', NULL, '', 1, 3, '', '01047508889', '여', NULL, NULL, 31, NULL, 10, '2019-12-29 00:25:07', NULL, '2', 'N'),
(378, '이경민', '- 1청 새가족으로 수료 후 언약팀에 배정. 이후 예배를 참여 안하게 되었는데 자세한 이유는..?<br/>- 정충만 형제랑 잠깐 교제를 했었음<br/>- 낮에 근무를 하고 공부를 함께 병행했던 것으로 기억함 <br/>- 최근(2020/12) 박지혜자매와 만나 근황을 나누었다고 전달받음', '', 2, 7, '930000', '01039413376', '여', NULL, NULL, 9, NULL, 3, '2019-12-29 00:26:02', NULL, '2', 'N'),
(379, '이서우', '[2월26일 심방]<br/>현재 하나님과 관계가 많이 멀어져 있다고 고백했음.<br/>동성교회 청년부 말씀이 자신에게 많은 찔림이 되어 불편한 마음이 있고 현재 소망교회 온라인 예배를 드리고 있지만, 예배를 형식적으로 드리고 있는 자신을 보게 됨. <br/>3월 2일부터 새로운 직장 출근 (태평양 법무법인 / 종각)<br/>출근하게 될 회사가 야근과 주말 출근이 잦아 예배에 대해 시간을 내기 어려운 마음을 전해 줌..<br/><br/>기도: 마음과 생각을 잡아주시도록.. 마귀가 틈타지 않게 영혼을 보호하는 기도.', '', 2, 7, '931230', '01033547527', '여', NULL, NULL, 9, NULL, 3, '2019-12-29 00:26:11', NULL, '2', 'N'),
(380, '김다빈', NULL, '', 1, 3, '', '01093512986', '여', NULL, NULL, 31, NULL, 10, '2019-12-29 00:27:51', NULL, '2', 'N'),
(381, '이예슬', '명지대', '', 1, 3, '', '01064844482', '여', NULL, NULL, 31, NULL, 10, '2019-12-29 00:27:58', NULL, '2', 'N'),
(382, '송인희', '1.23 팀 리더모임 가운데 들은 내용(송연 순장 전달)- 송연 순장도 필립이에게 들은 내용.<br/>인희가 중학생때에 김현빈(김다빈 오빠)과 교제, 했었고 지인 관계를 유지했었지만, 현빈이가 한나에게 마음이 많아지기 전에 인희에게 교제하자 라는 식으로 접근했었고, 한나에게 많은 호감을 느꼇을때에 인희에게 시큰둥하게 나왔으며, <br/>최근에는 인희가 친구들과 교제도 하지 않으며, (추측으로는 싸움) 인희를 향한 좋지 않은 소문이 돈다고 합니다.  <br/>아마 송연순장 추측으로는 같이 놀던 친구들이 낸 소문 같다고 합니다 / 또 교회 지인중 유일하게 필립이만 인스타 친구인데 그 글 가운데 힘들다, 죽고 싶다 . 등등 부정적인 말들이 많다함.<br/>+ 교회에 대한 마음이 완전히 닫혀 있지는 않은듯함.<br/> 송연 순장이 지혜롭게.. 필립이와 함께 인희를 챙기도록 격려.', '', 1, 3, '', '01050565430', '여', NULL, NULL, 31, NULL, 10, '2019-12-29 00:28:04', NULL, '2', 'N'),
(383, '김목인', NULL, '', 1, 2, '', '01033870922', '남', NULL, NULL, 31, NULL, 42, '2019-12-29 00:35:12', NULL, '2', 'N'),
(384, '조수빈', '일대일양육 예정자-조송연<br/>- 수빈이는 예배와 순모임 등에 성실하게 참여합니다. 말씀에 대한 뜨거운 마음은 아직 느껴지진 않지만<br/>잠잠하게 계속해서 말씀 앞에 있으려고 하는 것 같아 감사합니다. 개인적으로 연락하며 근황을 나누고 있고 현재는 방학이라<br/>집에서 지내고 있는데 자격증 시험을 준비할거라고 합니다.<br/>하고싶은 것도  여러가지 있는 것같습니다.<br/>교회에서는 찬양팀(반주) 영상쪽에도 관심이 있어서 미디어팀도 권면해 보았습니다..<br/>그래도 계속해서 공동체에 대한 마음이 있어서 감사합니다. 언니들이 챙겨주려고 많이 애쓰고 있습니다(은석,신영 등)<br/><br/>- 누구에게 먼저 말을 털어놓지 못해 혼자 생각으로만 넘기고 지내던 일상 속에서 말씀과 기도의 자리가운데 주님이 위로해주심에 감사했습니다. 어려서부터의 환경이<br/>스스로 잘하고 알아서 잘하고 동기들 안에서도 타인에 의해서이긴 하지만 오히려 행해왔던 마음이 리더의 마음이 아닌가 싶은 생각도 들었습니다. 그럼에도 공동체에 붙어있게<br/>해주신 주님의 자리 가운데 잘 순종함으로 나아간 것이 감사합니다.(2021.01.28기준)', '', 1, 2, '', '01067221320', '여', NULL, NULL, 31, NULL, 42, '2019-12-29 00:35:21', NULL, '1', 'N'),
