(419, '김새봄', '5.8<br/>계단에서 뒤로 넘어지면서 허리를 다쳐서 앉아있기가 어려움.온라인 예배도 어려운 상황.<br/>하나님 앞에서 열심을 다하려고 할 때마다 상황이나 환경에 어려움이 생기는 것 같음.<br/><br/>낯가림이 심하다.<br/>새내기 환영회때 새가족 소개하는 시간이 있었는데<br/>단체로 소개했는데도  주목 받는 것이 불편해서  줌에서 나갔다.<br/>어떻게 해야할지 몰라서 나갔다고 한다.<br/>잘 살펴야겠다.', '', 2, 5, '', '01044321724', '여', NULL, NULL, 10, NULL, 13, '2021-01-02 19:45:35', NULL, '1', 'N'),
(420, '문신영', '1.3<br/>청주에서 친구가 올라왔는데 예배시간에 만나서 청년부 예배를 못드렸다. 1청에서도 예배 시간에 일정을 잡거나, 일정이 생기면 예배를 안드렸던 적이 몇번 있었는데 예배가 타협점이 되지는 않는지 잘 살피고 양육해야겠다.', '', 2, 5, '', '01066692217', '여', NULL, NULL, 8, NULL, 13, '2021-01-02 19:46:05', NULL, '1', 'N'),
(421, '김재선', '2.1일 전역!<br/>병원에서 보조일', '', 2, 5, '', '01093999407', '남', NULL, NULL, 8, NULL, 13, '2021-01-02 19:49:24', NULL, '1', 'N'),
(422, '김수영', '주일에 출근을 하는 경우가 있어서 주일을 잘 못지켰다고 함.<br/>이번주는 출근은 안했는데 예배나 모임은 참석하지 않음. ', '', 2, 5, '', '01072325033', '여', NULL, NULL, 8, NULL, 13, '2021-01-02 19:50:16', NULL, '1', 'N'),
(423, '이재은', '4.25<br/>승원이 휴가나와서 같이 시간을 보냄. 순모임 못함.<br/>3.13<br/>최근에 만나서 나누면서 가정 특히 엄마와의 갈등이 심각하고 스트레스가 많음을 나눔.<br/>엄마랑 대화 자체가 안되서 말을 잘 안하게 되고 용서할 수 없이 미운 마음이 가득..<br/>예전에는 엄마만큼 하나님을 사랑하는 사람이 없다고 생각했는데 요즘을 보면 저것만큼 가짜인게 있을까 싶은 생각이 들고 엄마아빠한테 기대가 없어서 동생한테 더 의지를 많이 하게 됨.<br/><br/>오래전부터 위랑 장이 아팠는데 최근에  더 많이 아프고 너무 오래가는 것 같아서 6일 수요일에 <br/>대학병원에서 내시경 진료 예정.<br/>별 일 아니길 기도부탁함.<br/><br/>최근에 회사에 확진자의 밀접접촉자가 나와서<br/>회사가 잠시 비상.. 다행히 음성이었지만 서로가<br/>조심하기로 해서 사람들을 거의 만나지 않음', '', 2, 5, '', '01088082026', '여', NULL, NULL, 8, NULL, 13, '2021-01-02 19:52:13', NULL, '1', 'N'),
(424, '이종훈', '3.13<br/>매일 경건생활 하려고 애쓰는데 마음이 크게 뜨겁지는 않다고 스스로 생각함.<br/>찬양팀에서 총무를 맡아 한달에 한번 줌모임을 인도하는데  스스로  마음에 은혜가 없는데 무슨 말을 하고 어떤 모임을 이끌어야할지 막막해함.<br/>순공부를 할때도 내용이 이해는 되지만 아주 멀게 느껴진다고.. 순공부 내용이 와닿지 않으면서 생각해보니 본인이 하나님과 멀어져 있음을 발견<br/><br/>1.14<br/>2청으로 올라온 것도 좀 어려웠고(1청에 더 남고싶은 아쉬움+호연주옥 등 친한 동기들이 팀장으로 남은 것에 좀 어려움)<br/>찬양팀에서도 좀 어려움이 있음 (인도자에 대한 어려움인데 지각하는 부분이나..  인도자가 바뀌면서 변하는 것들이 있는데  방법들이 좀 어려움이 되나봅니다)', '', 2, 5, '', '01025235231', '남', NULL, NULL, 8, NULL, 13, '2021-01-02 19:52:47', NULL, '1', 'N'),
(425, '김현아', '1.23<br/>재작년 크리스마스에  영국에서 교회 간 것이 마지막.<br/>순장이 교회 온라인  주소 공유해줘서 가능할때 예배 드리려고함.<br/>1.14<br/>5월달쯤에 한국에 들어올 예정, 잠깐 있다가 다시 나갈 예정', '', 2, 5, '', '01042117514', '여', NULL, NULL, 8, NULL, 13, '2021-01-02 19:53:31', NULL, '3', 'N'),
(426, '오상아', '2021년 1월<br/><br/>-카톡이 정지되어 있는 상태/ 라인으로 연락가능<br/>-다행히 예배와 2부모임도 잘 참여해 주고 있음<br/>-현재는 회사를 쉬고 있는 상태<br/>-집에서 독립하려고함 (고시원) 일을 쉬고 있고 봄에 다시 일을 구하려고 함<br/>', '', 2, 6, '198911', '01040228399', '남', NULL, NULL, 13, NULL, 2, '2021-01-02 19:53:42', NULL, '1', 'N'),
