(431, '현지성', '- 주은평 선교사님 자녀 <br/>- 어린 시절 중국에서 생활함<br/>- 춤 추는 것을 좋아하고 선교에 대한 마음이 있음<br/>- 감정의 기복이나 생각으로 인해 가끔 잠수를 탈 때가 있었음', '', 2, 7, '', '01037507264', '남', NULL, NULL, 8, NULL, 3, '2021-01-02 20:50:01', NULL, '1', 'N'),
(432, '이창희', '2019(?)정도부터 청년부에 다시 나오기 시작함.<br/>졸업한 오세희 형제와 친구. 정감마을 이가희 동생.<br/>중곡역 앞 이가네 오리고기집.<br/>하나님을 막 알기 시작하여 마음에 은혜가 있고 더 하나님을 알기 원하는 갈급한 마음이 있어 보입니다.<br/>동생들을 잘 챙기고 영혼들을 편견과 차별없이 잘 대해줍니다.', '', 2, 7, '', '01090363281', '남', NULL, NULL, 8, NULL, 3, '2021-01-02 20:50:38', NULL, '1', 'N'),
(433, '정주원', '- 대학생 때 IVF 동아리 활동을 했고 거기서 만난 자매와 교제중<br/>- 1청 #001소망품은 동산팀#001에 있을 때 리더로 섬겼음<br/>- 2020년에 취업해서 직장생활 중', '', 2, 7, '941121', '01094493275', '남', NULL, NULL, 8, NULL, 3, '2021-01-02 20:51:02', NULL, '1', 'N'),
(434, '이다은', '- 목사님 자녀<br/>- 청년부에 올라오고 한동안 예배 출석을 안하다가 2019년 정도부터 세은, 신영 영향으로 다시 출석하게 됨', '', 2, 7, '', '01064095299', '여', NULL, NULL, 8, NULL, 3, '2021-01-02 20:51:22', NULL, '1', 'N'),
(435, '이유진', '현재 본가에 있고 3월에 온다고 함 <br/>순모임에 예습도 하고 잘 <br/><br/>- 본가는 여수인데 서울로 오게 되어 동성교회 출석하게 됨<br/>- 2021 새가족 수료<br/>- 이모 통해서 작년 10월 오게되었음. (모태신앙)<br/>- 코로나로 인해 대면 만남은 어려워하고 말씀을 받고 나누는걸 좋아해서 순모임 적극적으로 참여.<br/>', '', 2, 7, '', '01076426524', '여', NULL, NULL, 13, NULL, 3, '2021-01-02 20:51:44', NULL, '1', 'N'),
