(438, '이주호', '-3/16일 한국입국 일년정도 머물예정<br/>-향은순으로<br/>-P/T트레이너(서대문)로 일단 일하게 됨', '', 2, 7, '', '01024788196', '남', NULL, NULL, 8, NULL, 3, '2021-01-02 20:52:40', NULL, '3', 'N'),
(439, '박성인', '[2021/01/23]<br/>- 처음으로 일대일 만남을 해보았는데 마음이 많이 열려있기도 하고 2청 팀에 대한 기대감도 있어 보여서 감사했습니다.<br/>- 밝아 보이지만 마음에 불안함도 있어 보였고 열심히 살려고 애쓰는 모습 속에 하나님을 더 의지하며 성인이에게 자유와 평안이 임하면 좋겠다는 기도의 마음이 들었습니다. <br/>- 평소 통성기도 때 집중이 잘 안된다고 했고 오전부터 드리는 예배로 청년부예배 때 가끔은 피로할 때가 있다고 나눠줘서  마음이 쓰였습니다.<br/><br/>[기본 인적 사항]<br/>- 본가는 군산, 서울에서 언니와 자취 (내방역근처 / 언니: 사랑의교회)<br/>- 문신영 자매 전도로 동성교회 오게 됨<br/>- 밝고 열린 마음. 아직 세상적인 부분에 대해 고민하지만 하나님을 알고 싶어하고 갈급한 마음이 있음 (마음밭이 좋아보임)', '', 2, 7, '', '01062401049', '여', NULL, NULL, 8, NULL, 3, '2021-01-02 20:54:16', NULL, '1', 'N'),
(440, '황요한', '[2021/01/18]<br/>- 최근 호프선교회에서 진행한 인카네이션 훈련을 마쳤고(4주과정) 그 전에 영적으로 자신의 교만한 모습이 직면되어 어려움이 있었는데 훈련을 들으며 따뜻함을 많이 받았다 했습니다.<br/>- 오랜만에 만나 나눴는데 마음이 좀 닫혀있는 느낌이었고 자신이 소망하는 바는 있으나 지속되지 않음으로 오는 낙심함이 있어 보였습니다.<br/>- 팀내에 형제 리더로 같이 마음 모아보기를 소망하는 부분도 있으나 현재는 개인의 영적 회복이 우선되는것 같아 보였고 그래서 더 깊게 나누지는 않았습니다. 조금의 기다림이 필요해 보였습니다~<br/><br/>[기본 인적 사항]<br/>- 2020년까지 ‘소망품은 동산팀’ 팀장으로 섬김<br/>- 현재(~2021) 은행에서 근무 (보안업무)<br/>', '', 2, 7, '', '01023456624', '남', NULL, NULL, 12, NULL, 3, '2021-01-02 20:56:56', NULL, '1', 'N'),
(441, '장정훈', '- 졸업한 최호준 형제가 전도<br/>- 정신적인 어려움이 있었던 것으로 기억(공황장애)<br/>- 새가족 수료 후 지속적으로 예배 참석이 어려웠고 현재 장결 상황', '', 2, 7, '', '01020166758', '남', NULL, NULL, 8, NULL, 3, '2021-01-02 20:57:13', NULL, '2', 'N'),
(442, '이정연', '4월 말까지 회사를 다시고 그만 둘 예정임', '', 2, 6, '', '01049643540', '여', NULL, NULL, 8, NULL, 2, '2021-01-02 22:09:57', NULL, '1', 'N'),
(443, '한희진', '2021년 1월<br/><br/>-HOPE 다니고 있음', '', 2, 6, '', '01046131547', '여', NULL, NULL, 8, NULL, 2, '2021-01-02 22:10:07', NULL, '1', 'N'),
(444, '김세은', '2021년 1월<br/><br/>-등대팀에서 올라옴<br/>-아직 마음이 완전히 열리진 않은 것 같음..(주일 예배만 드림)<br/>-은행팀 단톡방에서 묵상나눔은 해주고 있음<br/>-하나님과의 관계가 어려워짐. 회피하고 싶은 마음이 큰 상태', '', 2, 6, '', '01020531784', '여', NULL, NULL, 8, NULL, 2, '2021-01-02 22:10:18', NULL, '1', 'N'),
(445, '최민석', '2021년 1월<br/><br/>-현재 공부하며 지내고 있고 방학이지만 자격증, 토익등 을 준비하면서 지내고 있음', '', 2, 6, '', '01071809489', '남', NULL, NULL, 8, NULL, 2, '2021-01-02 22:10:32', NULL, '1', 'N'),
