(454, '윤회진', '주일에 쉬는 날 이라서 예배는 참석.<br/>(근데 얼굴은 못봤습니다..)<br/>예배 참석 후 순모임은 연락이 안되어서 불참했습니다', '', 1, 1, '', '', '남', NULL, NULL, 32, NULL, 60, '2021-01-02 22:17:03', NULL, '1', 'N'),
(455, '이범혁', '2021년 1월<br/>- 신학준비, 낮에는 주로 운동(with 창희), 저녁에는 약속 있는 패턴으로 살고 있음<br/>-월요일 교회 당직 근무시작', '', 2, 6, '', '01093903649', '남', NULL, NULL, 8, NULL, 2, '2021-01-02 23:09:29', NULL, '1', 'N'),
(456, '김현민', '마음이 많이 뜬 상황<br/>군대를 신청중에 있으며, 자신의 마음을 잘 드러내려 하지 않고, 인정하지 않음.<br/>지난 주 부터 다시 태권도 도장에 출근중.. <br/>게임을 많이 좋아하는 친구, 로스트아크 라는 RPG게임  + 다수의 게임 합니다.<br/><br/>3월 9일 입대. - 4월 12일 자대 37사단 110여단 2대대 / 기관총병<br/>5.10 / 카톡방 나가고, 물어보니 생각할 것들이 많다고 하는데, 아직은 답장이 없음. ', '', 1, 3, '', '01066930984', '남', NULL, NULL, 3, NULL, 30, '2021-01-03 17:07:06', NULL, '1', 'N'),
(457, '이윤', '전화 심방 해보면, 예배시간을 피하고, 2부 순서도 참여하고 싶지 않아함.<br/>접촉을 최대한 피하고자 함.<br/>#002예배만 드리고 싶어요, 예배는 엄마가 드리라 하니까 드리지만 나머지는 참여하고 싶지 않습니다.#002 <br/>윤이가 솔직하게 이야기 해 준 내용입니다.<br/>성인 이후의 자유!! 를 만끽하고 싶어함.<br/>1.24/ 예배 참여,, H-#001어떻게 왔어?#001 Y-#001엄마가 가래요#001 허허.. ', '', 1, 3, '', '', '남', NULL, NULL, 32, NULL, 30, '2021-01-03 17:14:11', NULL, '1', 'N'),
(458, '정수환', '연락과 답장이 잘 되지만, 예배까지는 아직 어려운 듯 합니다. <br/><br/>게속 해서 연락 유지. <br/><br/>2주 ~ 3주 카톡을 읽지 않음. 연락 두절', '', 1, 3, '', '', '남', NULL, NULL, 32, NULL, 30, '2021-01-03 17:14:20', NULL, '1', 'N'),
(459, '이지훈', '지훈이는 토요일에 순 교제 전달해 주면서 공시? 준비중으로 들었음.<br/><br/>깨우면 예배까지는 가능한지만,, 아직은 많이 땡겨줘야 할 거 같음.<br/>연락도 잘 됩니다.<br/><br/>1/31 소방 공무원 준비 / 이번 년도의 초점은 준비 라고 합니다.<br/>스스로의 나눔이 어려움. ( 공감, 동조를 많이 함 )<br/><br/>3.3 / 주일에 은서의 연락이 부담스럽고 교회에 나가기 싫다고 이야기를 하며, 연락 하지 말라고 전화를 했지만 은서 순장이 잘 독려하여 <br/>한 달에 한, 두번은 연락하기로 함.<br/><br/>4.17 / 시험 낙방,', '', 1, 3, '', '', '남', NULL, NULL, 32, NULL, 30, '2021-01-03 17:14:27', NULL, '1', 'N'),
(460, '윤주영', '예배도 2부 순서도 잘 나아오고 있는 친구 <br/>게임을 좋아하며, 지금은 쉬면서 다양한 것들을 경험해 보고 싶어합니다. ex) 영상편집<br/><br/>경희대(국제캠퍼스/수원)<br/>1.24 / am3시 취침 ... pm4시.<br/>5.10 / 푸시에 대한 피드백은 항상 있는 친구이지만, 하나님에 대해서는 아직 선을 긋고 있음.<br/>3.25 / 순모임 공부 가운데 잘 듣고자 하며, 아직은 지식적으로 다가오는 듯<br/><br/>4.17 시험기간 으로 예배 불참..', '', 1, 3, '', '', '남', NULL, NULL, 32, NULL, 30, '2021-01-03 17:14:33', NULL, '1', 'N'),
(461, '김진섭', '진섭이는 연락이 안댐.. 번호가 잘 못?<br/>그래서 페이스북이라는 sns를 통해 연락하고자 하고있음.<br/><br/>3.25  / 진섭이 연락은 닿음', '', 1, 3, '', '', '남', NULL, NULL, 32, NULL, 30, '2021-01-03 17:14:39', NULL, '1', 'N'),
(462, '최원', 'JDM 대표<br/>관악구로 이사감', '', 1, 9, '', '', '남', NULL, NULL, 4, NULL, 16, '2021-01-03 17:19:31', NULL, '1', 'N'),
(463, '차승민', '원주대 원서 접수. 결과 기다리는 중(1월 말 결과 나옴)', '', 1, 9, '', '', '남', NULL, NULL, 32, NULL, 16, '2021-01-03 17:19:56', NULL, '1', 'N'),
(464, '양정훈', '정훈이는 제 연락은 일절 받지 않고.. 승민이 통해서만 연락이 닿습니다. 이번에 새내기 지원금 나와서 승민이랑 정훈이랑 셋이 보려고 승민이한테 물어봐 달라 했는데 싫다고 했다네요..ㅎㅎ', '', 1, 9, '', '', '남', NULL, NULL, 32, NULL, 16, '2021-01-03 17:21:20', NULL, '2', 'N'),
(465, '이정우', NULL, '', 1, 9, '', '', '남', NULL, NULL, 32, NULL, 16, '2021-01-03 17:21:30', NULL, '2', 'N'),
(466, '양현서', '학교 입학 전 친구들과 재미있게 놀며 시간을 보내고 있습니다. 예배와 순모임은 적극적으로 기대하는 마음으로 참여하고 있습니다.(2021.01.11기준)', '', 1, 2, '', '01032750342', '남', NULL, NULL, 32, NULL, 4, '2021-01-03 18:24:21', NULL, '1', 'N'),
(467, '이동석', '평소에 게임을 하며 시간을 보내고 있는것같습니다. 예배와 순모임에는 잘 참여하고 있으며 나눔이나 대화를 제대로 해본적이 아직 없습니다.(21.01.11기준)', '', 1, 2, '', '01062834499', '남', NULL, NULL, 32, NULL, 4, '2021-01-03 18:25:07', NULL, '1', 'N'),
(468, '하승준', '청년부 예배 외에 다른 모임들에 참여하는 것에 대한 거부감이 있습니다. 마음이 아직은 많이 닫혀있지만 계속 연락하며 끌어주면 좋을것같습니다.<br/>연락을 잘 받아주고 만나자고 하면 잘 만나줍니다. 계속 기도하며 친구들을 전도했으면 좋겠습니다..(2021.01.11기준)<br/><br/>- 현재는 운전면허 준비하며 나머지 시간은 친구들과 게임방에 가고 있습니다.(2021.01.28기준)<br/><br/>- 3월달 대학교 개강, 4-5월달쯤 군대 신청 한다고 합니다. 되면 7-10월 사이에는 갈것같습니다..(2021.02.22기준)', '', 1, 2, '', '01049142682', '남', NULL, NULL, 32, NULL, 4, '2021-01-03 18:28:17', NULL, '1', 'N'),
(469, '우현도', NULL, '', 1, 2, '', '01036941650', '남', NULL, NULL, 32, NULL, 4, '2021-01-03 18:29:00', NULL, '1', 'N'),
