(472, '한효정', '은석이랑 연락이 잘 안되고 있습니다. 순원이라 먼저 연락이 닿으면 알려달라고 한 상태입니다. 은석이 말로는 조금 귀찮아서 답장을 안할때도 있다고 합니다(2021.01.11기준)', '', 1, 2, '', '01071180756', '여', NULL, NULL, 3, NULL, 4, '2021-01-03 18:34:12', NULL, '1', 'N'),
