INSERT INTO `team` (`id`, `depart_id`, `t_short_name`, `t_full_name`, `t_theme`, `reg_user`, `del_yn`) VALUES
(1, '1', '기쁨', '기쁨의 나라', '고린도전서 13장 [개역개정]\r\n12  우리가 지금은 거울로 보는 것 같이 희미하나 그 때에는 얼굴과 얼굴을 대하여 볼 것이요 지금은 내가 부분적으로 아나 그 때에는 주께서 나를 아신 것 같이 내가 온전히 알리라', 1, 'N'),
(2, '1', '언약', '언약의 숲', '너희는 너희가 하나님의 성전인 것과 하나님의 성령이 너희 안에 계신 것을 알지 못하느냐 고린도전서3장16절', 1, 'N'),
(3, '1', '등대', '목자의 등대', '오직 내가 이것을 그들에게 명령하여 이르기를 너희는 내 목소리를 들으라 그리하면 나는 너희 하나님이 되겠고 너희는 내 백성이 되리라 너희는 내가 명령한 모든 길로 걸어가라 그리하면 복을 받으리라 하였으나 (렘7:23)', 1, 'N'),
(4, '1', '새가족', '1청년부 새가족팀', '[2020 말씀]\r\n고린도전서 2:2 내가 너희 중에서 예수 그리스도와 그가 십자가에 못 박히신 것 외에는 아무 것도 알지 아니하기로 작정하였음이라', 1, 'N'),
(5, '2', '정감', '정이 넘치고 감사가 넘치는 마을', '2021\r\n[시119:105] 주의 말씀은 내 발에 등이요 \r\n내 길에 빛이니이다\r\n\r\n2020\r\n[요일4:11-12]\r\n11 사랑하는 자들아 하나님이 이같이 우리를 사랑하셨은즉 우리도 서로 사랑하는 것이 마땅하도다\r\n12 어느 때나 하나님을 본 사람이 없으되 만일 우리가 서로 사랑하면 하나님이 우리 안에 거하시고 그의 사랑이 우리 안에 온전히 이루어지느니라', 1, 'N'),
(6, '2', '은행', '하나되어 은혜롭고 행복한 공동체', '보라 내가 속히 오리니 이 두루마리의 예언의 말씀을 지키는 자는 복이 있으리라 하더라 요한계시록 22:7', 1, 'N'),
(7, '2', '열공', '열린 공동체', '[2021 말씀]\r\n오직 우리 주 곧 구주 예수 그리스도의 은혜와 그를 아는 지식에서 자라 가라 영광이 이제와 영원한 날까지 그에게 있을지어다 [베드로후서 3:18]\r\n\r\n[2020 말씀]\r\n누구든지 자기 십자가를 지고 나를 따르지 않는 자도 능히 내 제자가 되지 못하리라 [누가복음 13:27] ', 1, 'N'),
(8, '2', '새가족', '2청년부 새가족팀', '[2020 말씀]\r\n누가복음 15:32 이 네 동생은 죽었다가 살아났으며 내가 잃었다가 얻었기로 우리가 즐거워하고 기뻐하는 것이 마땅하다 하니라\r\n\r\n2021 말씀\r\n(롬5:1)  그러므로 우리가 믿음으로 의롭다 하심을 받았으니 우리 주 예수 그리스도로 말미암아  하나님과 화평을 누리자 ', 1, 'N'),
(9, '1', '동산', '소망품은 동산', '고후4:7\r\n우리가 이 보배를 질그릇에 가졌으니 이는 심히 큰 능력은 하나님께 있고 우리에게 있지 아니함을 알게 하려 함이라', 1, 'N'),
(10, '3', '기타', NULL, NULL, 1, 'N'),
(11, '2', '새가족', NULL, NULL, 1, 'Y');
